import React, { useState, useEffect } from 'react';
import ComplianceCheck from '../components/compliance/ComplianceCheck';
import { ClipboardDocumentCheckIcon } from '@heroicons/react/24/outline';
import api from '../services/api';

interface ComplianceResult {
  id: string;
  type: string;
  status: 'COMPLIANT' | 'NON_COMPLIANT' | 'NEEDS_REVIEW';
  description: string;
  recommendations?: string;
}

const Compliance = () => {
  const [checks, setChecks] = useState<ComplianceResult[]>([]);
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    fetchComplianceChecks();
  }, []);

  const fetchComplianceChecks = async () => {
    try {
      const response = await api.get('/compliance');
      setChecks(response.data);
    } catch (error) {
      console.error('Error fetching compliance checks:', error);
    }
  };

  const runComplianceCheck = async () => {
    setIsLoading(true);
    try {
      const response = await api.post('/compliance/check', {
        type: 'GENERAL',
        data: {
          // Add compliance check parameters
        }
      });
      setChecks(prev => [response.data, ...prev]);
    } catch (error) {
      console.error('Error running compliance check:', error);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="px-4 sm:px-6 lg:px-8">
      <div className="sm:flex sm:items-center">
        <div className="sm:flex-auto">
          <h1 className="text-2xl font-semibold text-gray-900">Compliance Checks</h1>
          <p className="mt-2 text-sm text-gray-700">
            Monitor and maintain legal compliance for your business
          </p>
        </div>
        <div className="mt-4 sm:mt-0 sm:ml-16 sm:flex-none">
          <button
            type="button"
            onClick={runComplianceCheck}
            disabled={isLoading}
            className="inline-flex items-center justify-center rounded-md border border-transparent bg-indigo-600 px-4 py-2 text-sm font-medium text-white shadow-sm hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2 sm:w-auto disabled:opacity-50"
          >
            <ClipboardDocumentCheckIcon className="-ml-1 mr-2 h-5 w-5" aria-hidden="true" />
            Run Compliance Check
          </button>
        </div>
      </div>

      <div className="mt-8 space-y-6">
        {checks.map((check) => (
          <ComplianceCheck key={check.id} result={check} />
        ))}
      </div>
    </div>
  );
};

export default Compliance;
